import SideNavBar from "../Components/SideNavBar";
import Box from "@mui/material/Box";
import NavBar from "../Components/NavBar";
import { Stack } from "@mui/material";

function Author() {
  return (
    <>
    <NavBar />
    <Box>
      <Box height={30}/>
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Author</h1>
          <Stack spacing={2}>

          </Stack>
          </Box>
        </Box>
      </Box>
    </>
  );
}
export default Author;
